PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "countries" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "reports" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "title" varchar NOT NULL, "image" varchar, "recommend" varchar, "memo" varchar NOT NULL, "user_id" integer NOT NULL, "restaurant_id" integer NOT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
CREATE TABLE IF NOT EXISTS "users" ("id" integer PRIMARY KEY AUTOINCREMENT NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" datetime, "remember_created_at" datetime, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "provider" varchar, "uid" varchar, "username" varchar NOT NULL, "profile_image" varchar);
CREATE TABLE IF NOT EXISTS "likes" ("id" integer NOT NULL PRIMARY KEY, "restaurant_id" integer NOT NULL, "user_id" integer NOT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, CONSTRAINT "fk_rails_95783ab6c9"
FOREIGN KEY ("restaurant_id")
  REFERENCES "restaurants" ("id")
, CONSTRAINT "fk_rails_1e09b5dabf"
FOREIGN KEY ("user_id")
  REFERENCES "users" ("id")
);
CREATE TABLE IF NOT EXISTS "restaurants" ("id" integer NOT NULL PRIMARY KEY, "name" varchar NOT NULL, "postal_code" integer NOT NULL, "address" varchar NOT NULL, "image" varchar DEFAULT NULL, "latitude" float DEFAULT NULL, "longitude" float DEFAULT NULL, "memo" text DEFAULT NULL, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL, "user_id" integer DEFAULT NULL, "country_id" integer DEFAULT NULL, CONSTRAINT "fk_rails_ea7b7d7a30"
FOREIGN KEY ("country_id")
  REFERENCES "countries" ("id")
);
CREATE TABLE IF NOT EXISTS "schema_migrations" ("version" varchar NOT NULL PRIMARY KEY);
CREATE TABLE IF NOT EXISTS "ar_internal_metadata" ("key" varchar NOT NULL PRIMARY KEY, "value" varchar, "created_at" datetime(6) NOT NULL, "updated_at" datetime(6) NOT NULL);
DELETE FROM sqlite_sequence;
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
CREATE INDEX "index_likes_on_restaurant_id" ON "likes" ("restaurant_id");
CREATE INDEX "index_likes_on_user_id" ON "likes" ("user_id");
CREATE INDEX "index_restaurants_on_country_id" ON "restaurants" ("country_id");
COMMIT;
